ccount_subtitle:"Erhhe dein Level indem du spielst! Durch das Erhhen deines Levels erhht sich auch dein tglicher Bonus!",account_last_bets:"Letzten 10 Wetten",account_last_duels:"Letzten 10 Duelle",account_refresh:"Aktualisieren",account_bet_date:"Datum",account_bet_winnings:"Gewinne",account_bet_color:"Farbe",account_duel_date:"Datum",account_duel_winnings:"Gewinne",account_duel_color:"Farbe",transfer_title:"Senden",transfer_deposit_subtitle:"Einzahlen",transfer_button:"Senden",rewards_title:"Belohnung",rewards_verify_description:"Bitte verifiziere deinen Account um sicherzustellen, dass du kein Computerprogramm bist. <br/><br/>Du musst <span class='redtext'>CS:GO</span> besitzen und dein Steam Profil muss <span class='redtext'>ffentlich</span> sein.<br/>(Diese Eingaben knnen nach der Verifizierung zurckgesetzt werden)<br/>",rewards_verify_button:"Profil verifizieren",rewards_description:"Sammeln Sie ihren tglichen Bonus ein! Durch das Erhhen ihres Levels erhalten sie einen hheren Bonus. <br/>Laden Sie zudem Freunde ein um noch mehr kostenlose Bux zu erhalten!",rewards_referral_subtitle:"Einladungen",rewards_referral_description:"Zum Einsammeln",rewards_referral_claim:"Einsammeln",rewards_referral_claimed:"Eingesammelt",rewards_reward_subtitle:"Tgliche Belohnung",rewards_reward_claim:"Einsammeln",rewards_reward_claimed:"Eingesammelt",rewards_group_subtitle:"Steam Gruppe beitreten",rewards_group_description:"Werde ein Teil von uns!",rewards_group_claim:"Einsammeln",rewards_note:"* Steigere dein Level um deine tgliche Belohnung zu erhhen!",rewards_redeem_description:"Benutze einen Referral-Code (Receive <span class='redtext'>1,000</span> Bux):",rewards_redeem_button:"Einlsen",rewards_referral_code_description:"Teile deinen Referral-Code! (Gib <span class='redtext'>1,000</span> Bux, erhalte <span class='redtext'>50</span> Bux):",rewards_referral_code_button:"Aktualisieren",faq_title:"FAQ",faq_provably_question:"Was ist 'Provably Fair'?",faq_provably_answer:"<p>Provably Fair beweist, dass das Ergebnis einer Runde generiert wird, bevor die Setzphase beginnt. Der Ausgang der Runde kann nachtrglich nicht verndert werden.<br />\nDies beweist, dass die Website/Admins das Ergebnis der Runde nicht verndern knnen nachdem die Wetten eingegangen sind.</p>\n\n<p>Um zu beweisen, dass eine Runde fair ist, stelle sicher das die folgende Gleichung zutrifft:</p>\n\n<p><i>SHA256(Salt + Random) = Hash</i></p>\n\n<pre>Beispiel:\n\nHash: e66462d3c7baf608af84d1b3e2b2e0b25fad030eb04de4757e627812be79dfa0\nSalt: 2c2d9fa7bf4b037640067f102c0c8707\nRandom: 31\n\nEingabe: 2c2d9fa7bf4b037640067f102c0c870731\nAusgabe: e66462d3c7baf608af84d1b3e2b2e0b25fad030eb04de4757e627812be79dfa0\n\nSowohl Eingabe & Ausgabe sind gleich, hierdurch ist sicherzustellen, dass die Runde Provably Fair ist.</pre>\n\nDu kannst diesen Vorgang testen indem du einen SHA256 Hash Rechner nutzt, wie {faq_provably_link}",faq_chat_question:"Warum kann ich den Chat nicht nutzen?",faq_chat_answer:"Um chatten zu knnen musst du mindestens Level 10 erreicht haben. Wir mchten damit unerwnschte, massenhafte Nachrichten im Chat vorbeugen.",faq_level_question:"Wie erhhe ich mein Level?",faq_level_answer:"Pro 50,000 gewetteten Bux auf dem Hauptrad oder in den Duels steigen Sie ein Level auf.<br/>Je hher Ihr Level ist, desto hher ist Ihre tgliche Belohnung.",faq_referral_question:"Wie viel erhalte ich fr einen Referral-Code?",faq_referral_answer:"Du erhlst 50 Bux und jeder eingeladene Spieler erhlt 1,000 Bux.",faq_location_question:"Warum wurde mein Aufenthaltsort blockiert?",faq_location_answer:"Benutzer aus den Vereinigten Staaten von Amerika und dem Vereinigten Knigreich haben keinen Zugriff auf CSGO500.<br/>Aufgrund der Gesetze und Vorschriften der jeweiligen Lnder knnen wir diesen Benutzern keinen Zugriff gestatten.<br/>Falls du auf Probleme stoen oder schlechte Erfahrung mit dieser Sperre machen solltest, bitte kontaktiere den Support und wir werden die Probleme rechtzeitig beheben.",faq_responsible_question:"Verantwortliches wetten",faq_responsible_answer:"Es ist wichtig, dass du immer in voller Kontrolle deines Verhaltens und deiner Entscheidungen bist, wenn du auf CSGO500 spielst.<br /> Deshalb solltest du dir angemessene Limits setzen und nicht mehr wetten, als du solltest. <br/> Solltest du erkennen, dass du nicht mehr unter deiner vollen Kontrolle bist, dann bitte kontaktiere unseren Support und wir werden selbstverstndlich deinen Zugriff auf der Seite einschrnken.",faq_support_question:"Du bentigst noch Hilfe?",faq_support_answer:"Du kannst uns unter support@csgo500.com kontaktieren oder klicke auf das Symbol rechts unten im Bildschirm. <br/>Bitte stelle sicher, dass du deine Steam ID hinzufgst.",faq_provably_link:"<a class='redtext' href='http://www.xorbin.com/tools/sha256-hash-calculator' target='_blank'>dieser</a>.<br/>",notification_double_rewards:"Doppeltes Belohnungs-Wochenende bis Sonntag 23:59PM GMT!",notification_bet_login:"Bitte melde dich an, um zu setzen.",notification_bet_ban:"Du bist zurzeit vom Wetten gesperrt.",notification_bet_block:"Dein Aufenthaltsort wurde blockiert. Bitte les die FAQ, um mehr Informationen zu erhalten!",notification_bet_max_number:"Du kannst nicht mehr als 4 Wetten zur selben Zeit haben!",notification_bet_min:"Du musst mindestens 10 Bux setzen.",notification_bet_enough:"Nicht genug Bux zum setzen.",notification_bet_unsuccessful:"Es gab ein Problem beim Verarbeiten deiner Wette.",notification_bet_failed:"Wette Fehlgeschlagen",notification_autobet_invalid:"Autobet: Falsche Parameter.",notification_transfer:"{value} Bux wurde(n) berwiesen.",notification_transfer_failed:"Transfer Fehlgeschlagen",notification_transfer_server_error:"Serverfehler beim berweisen.",notification_transfer_invalid_number:"Falsche Eingabe beim berweisen.",notification_bet_refresh:"Wetten aktualisiert.",notification_bet_server_error:"Serverfehler beim Setzversuch.",notification_reconnecting:"Erneute Verbindung wird hergestellt...",notificati